import java.util.HashSet;
public class HashSetMethods {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet hs=new HashSet();//it not maintain insertion order.
		hs.add(10);
		hs.add("bipin");
		hs.add("20");
		hs.add(90);
		hs.add(5);
		hs.add(-5);
		hs.add(0);
		System.out.println(hs);
		
		
	}

}
